import React, { useState } from 'react';
import axiosInstance from '../../api/axiosInstance';
import useAuth from '../../auth/useAuth';

const PenitipanSenjataApiSelainPenumpangInput = () => {
  const { auth } = useAuth();
  const [formData, setFormData] = useState({
    tanggal: '',
    nama_pemilik_senjata: '',
    data_penumpang: '',
    no_simsa: '',
    jenis_senjata_api: '',
    nomor_senjata_api: '',
    jumlah_amunisi: '',
    jam_titip: '',
    jam_ambil: '',
    no_telp: '',
    ttd: '',
  });
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess('');
    try {
      const response = await axiosInstance.post('/penitipan-senjata-api-selain-penumpang', { ...formData, user_id: auth.user.user_id });
      setSuccess('Form submitted successfully!');
      setFormData({
        tanggal: '',
        nama_pemilik_senjata: '',
        data_penumpang: '',
        no_simsa: '',
        jenis_senjata_api: '',
        nomor_senjata_api: '',
        jumlah_amunisi: '',
        jam_titip: '',
        jam_ambil: '',
        no_telp: '',
        ttd: '',
      });
    } catch (err) {
      setError(err.response?.data?.message || 'An error occurred');
    }
  };

  return (
    <form onSubmit={handleSubmit} className="max-w-md mx-auto p-4 bg-white rounded shadow space-y-4">
      <div>
        <label className="block font-medium mb-1">Tanggal</label>
        <input type="date" name="tanggal" value={formData.tanggal} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Nama Pemilik Senjata</label>
        <input type="text" name="nama_pemilik_senjata" value={formData.nama_pemilik_senjata} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Data Penumpang</label>
        <input type="text" name="data_penumpang" value={formData.data_penumpang} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">No. SIMSA</label>
        <input type="text" name="no_simsa" value={formData.no_simsa} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Jenis Senjata Api</label>
        <input type="text" name="jenis_senjata_api" value={formData.jenis_senjata_api} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Nomor Senjata Api</label>
        <input type="text" name="nomor_senjata_api" value={formData.nomor_senjata_api} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Jumlah Amunisi</label>
        <input type="number" name="jumlah_amunisi" value={formData.jumlah_amunisi} onChange={handleChange} required className="border px-3 py-2 rounded w-full" min="0" />
      </div>
      <div>
        <label className="block font-medium mb-1">Jam Titip</label>
        <input type="time" name="jam_titip" value={formData.jam_titip} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Jam Ambil</label>
        <input type="time" name="jam_ambil" value={formData.jam_ambil} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">No. Telp</label>
        <input type="text" name="no_telp" value={formData.no_telp} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">TTD (base64)</label>
        <textarea name="ttd" value={formData.ttd} onChange={handleChange} className="border px-3 py-2 rounded w-full" />
      </div>
      <button type="submit" className="bg-blue-600 text-white px-4 py-2 rounded">Submit</button>
      {error && <p className="text-red-500 text-sm">{error}</p>}
      {success && <p className="text-green-600 text-sm">{success}</p>}
    </form>
  );
};

export default PenitipanSenjataApiSelainPenumpangInput;
